class Stack:

    def __init__(self):

        self.stack = []

    def size(self):

        return len(self.stack)

    def pop(self):

        if len(self.stack) != 0:
            ex = self.stack[-1]
            self.stack.remove(self.stack[-1])
            return ex
        else:
            return None

    def push(self, value):

        return self.stack.append(value)

    def peek(self):

        if len(self.stack) != 0:
            return self.stack[-1]
        else:
            return None

    def sorting(self, string):

        a = '('
        b = ')'
        for i in string:
            if i == a:
                self.push(i)
            else:
                if len(self.stack) != 0:
                    self.pop()
                else:
                    a, b = b, a
                    self.push(i)
        if len(self.stack) == 0:
            print('balans')
        else:
            print('no_balans', len(self.stack), self.stack[0])

import unittest

class Test_Stack(unittest.TestCase):

    def test_size(self):

        for i in range(10):
            test_stack.push(i)
        self.assertEqual(len(test_stack.stack), 10)

    def test_pop(self):

        for i in range(10):
            test_stack.push(i)
        for i in range(9, -1, -1):
            self.assertEqual(test_stack.pop(), i)

    def test_push(self):

        for i in range(10):
            test_stack.push(i)
        self.assertEqual(len(test_stack.stack), 10)
        self.assertEqual(test_stack.stack[0], 0)
        self.assertEqual(test_stack.stack[9], 9)

    def test_peek(self):

        for i in range(10):
            test_stack.push(i)
        for i in range(10):
            self.assertEqual(test_stack.peek(), test_stack.stack[-1])
            test_stack.pop()

    def tearDown(self):

        test_stack.__init__()

if __name__ == '__main__':

    test_stack = Stack()
    unittest.main(verbosity=2)

class Stack:

    def __init__(self):

        self.stack = []

    def size(self):

        return len(self.stack)

    def pop(self):

        if len(self.stack) != 0:
            ex = self.stack[0]
            self.stack.remove(self.stack[0])
            return ex
        else:
            return None

    def push(self, value):

        return self.stack.insert(0, value)

    def peek(self):

        if len(self.stack) != 0:
            return self.stack[0]
        else:
            return None

