def postfix(string):

    stack = []
    num = '0123456789'
    for i in string:
        if i == ' ':
            pass
        elif i in num:
            stack.append(int(i))
        else:
            if i == '+':
                stack = [stack[0] + stack[1]]
            elif i == '*':
                stack = [stack[0] * stack[1]]
            elif i == '=':
                return  stack[0]

print(postfix('8 2 + 5 * 9 + ='))
